#define restore_r1              do {                                                                        MR_r1 = MR_framevar(1);                                             } while (0)
#define restore_r1r2            do {                                                                        MR_r1 = MR_framevar(1);                                                 MR_r2 = MR_framevar(2);                                             } while (0)

